import styled from 'styled-components'

const base64 = require('base64')

const HomeContainer = () => {

    const image = require("../public/coding.png")

    return (
        <Container>
            <h1>teste</h1>
            <img
                src={"data:image/png;base64, " + base64.b64decode(image)}
                alt="Coding image"
                width={500}
                height={500}
            />
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
`

export default HomeContainer
